def md5(word):
    """ md5
    """
    result = word
    if isinstance(word, unicode):
        result = word.encode('utf-8')
    m = hashlib.md5()
    m.update(result)
    return m.hexdigest()

def urldecode(query):
    """ url解码，string -> dict
    """
    d = {}
    a = query.split('&')
    for s in a:
        if s.find('=') >= 0:
            k, v = map(urllib.unquote, s.split('=')[:2])
            d[k] = v
    return d

def str2time(name, from_format='%Y-%m-%d %H:%M:%S'):
    """ 把from_format的字符串转成时间类型
    """
    return datetime.strptime(name, from_format)


def time2str(time, to_format='%Y%m%d%H%M%S'):
    """ 把时间类型转换未to_format的字符串
    """
    return time.strftime(to_format)


def timestamp2str(seconds):
    ltime = time.localtime(seconds)
    return time.strftime("%Y-%m-%d %H:%M:%S", ltime)

def datetime_from_now_distances(datetime_obj):
    """datetime类型时间距离now()差秒数"""
    if isinstance(datetime_obj, datetime):
        distances = datetime2timestamp(datetime_obj) - int(time.time())
        return distances
    else:
        return datetime_obj


def get_day_begin_time(date):
    return datetime.replace(date, hour=0, minute=0, second=0, microsecond=0)


def get_day_end_time(date):
    return datetime.replace(date, hour=23, minute=59, second=59, microsecond=999999)


def serialize_values(dict_object):
    for key in dict_object:
        if isinstance(dict_object[key], datetime):
            dict_object[key] = format_datetime_to_string(dict_object[key])
